#!/bin/bash

# Agent Coordination Query Script
# Allows agents to query about file ownership, active work, and coordination status

set -e

COORDINATION_DOC="docs/development/workflow/AGENT_COORDINATION.md"

# Colors for output
RED='\033[0;31m'
GREEN='\033[0;32m'
YELLOW='\033[1;33m'
BLUE='\033[0;34m'
NC='\033[0m' # No Color

# Print usage
usage() {
    echo "Agent Coordination Query Tool"
    echo ""
    echo "Usage: $0 <command> [options]"
    echo ""
    echo "Commands:"
    echo "  check-file <file-path>     Check if a file is part of active work"
    echo "  list-active                List all active work entries"
    echo "  check-conflicts <file>...   Check for conflicts with given files"
    echo "  who-owns <file-path>       Find which task owns a specific file"
    echo "  status <task-name>         Get status of a specific task"
    echo "  help                       Show this help message"
    echo ""
    echo "Examples:"
    echo "  $0 check-file app/src/main/.../LandingScreen.kt"
    echo "  $0 list-active"
    echo "  $0 check-conflicts app/build.gradle.kts build.gradle.kts"
    echo "  $0 who-owns app/src/main/.../DataModule.kt"
    echo ""
}

# Check if coordination doc exists
check_coordination_doc() {
    if [ ! -f "$COORDINATION_DOC" ]; then
        echo -e "${RED}‚ùå ERROR: Coordination document not found${NC}"
        echo "   Expected: $COORDINATION_DOC"
        echo "   Create it or check the path"
        exit 1
    fi
}

# Extract active work entries from coordination doc
extract_active_work() {
    # Extract task blocks that are "In Progress" or don't have "Complete" status
    awk '
    /^### Task:/ {
        task = $0
        role = ""
        branch = ""
        status = ""
        files = ""
        in_files = 0
        next
    }
    /^\*\*Role\*\*:/ {
        role = $0
        next
    }
    /^\*\*Branch\*\*:/ {
        branch = $0
        next
    }
    /^\*\*Status\*\*:/ {
        status = $0
        # Check if status contains "Complete" or "‚úÖ"
        if (status ~ /Complete|‚úÖ/) {
            skip_task = 1
        } else {
            skip_task = 0
        }
        next
    }
    /^\*\*Files Modified\*\*:/ {
        in_files = 1
        next
    }
    /^## / && in_files {
        in_files = 0
        if (!skip_task) {
            print "TASK_START"
            print task
            print branch
            print status
            print "FILES_START"
            print files
            print "FILES_END"
            print "TASK_END"
        }
        task = ""
        branch = ""
        status = ""
        files = ""
        next
    }
    in_files && /^  - / {
        files = files $0 "\n"
    }
    END {
        if (!skip_task && task != "") {
            print "TASK_START"
            print task
            print branch
            print status
            print "FILES_START"
            print files
            print "FILES_END"
            print "TASK_END"
        }
    }
    ' "$COORDINATION_DOC"
}

# Check if a file is part of active work
check_file() {
    local file_path="$1"
    
    if [ -z "$file_path" ]; then
        echo -e "${RED}‚ùå ERROR: File path required${NC}"
        echo "   Usage: $0 check-file <file-path>"
        exit 1
    fi
    
    check_coordination_doc
    
    echo -e "${BLUE}üîç Checking file: $file_path${NC}"
    echo ""
    
    local found=0
    local current_task=""
    local current_branch=""
    local current_status=""
    
    while IFS= read -r line; do
        case "$line" in
            "TASK_START")
                current_task=""
                current_branch=""
                current_status=""
                ;;
            "### Task:"*)
                current_task="$line"
                ;;
            "**Branch:**"*)
                current_branch="$line"
                ;;
            "**Status:"*)
                current_status="$line"
                ;;
            "FILES_START")
                ;;
            "FILES_END")
                if [ $found -eq 1 ]; then
                    echo -e "${YELLOW}‚ö†Ô∏è  CONFLICT DETECTED${NC}"
                    echo ""
                    echo "   Task: $current_task"
                    echo "   $current_branch"
                    echo "   $current_status"
                    echo ""
                    echo -e "${YELLOW}üí° Recommendation:${NC}"
                    echo "   1. Check coordination doc: $COORDINATION_DOC"
                    echo "   2. Coordinate with the task owner"
                    echo "   3. Use git worktree for isolation"
                    echo "   4. Consider sequential work if file is shared"
                    echo ""
                    return 1
                fi
                ;;
            "TASK_END")
                ;;
            *)
                # Check if line contains the file path
                if echo "$line" | grep -q "$file_path"; then
                    found=1
                fi
                ;;
        esac
    done < <(extract_active_work)
    
    if [ $found -eq 0 ]; then
        echo -e "${GREEN}‚úÖ File is not part of any active work${NC}"
        echo ""
        echo "üí° You can proceed, but:"
        echo "   1. Check if file is in 'Shared Files' section"
        echo "   2. Update coordination doc with your work"
        echo "   3. Use git worktree if modifying shared files"
        return 0
    fi
}

# List all active work
