                fi
                ;;
            *)
                if [ $in_task -eq 1 ]; then
                    current_files="${current_files}${line}"$'\n'
                fi
                ;;
        esac
    done < <(extract_active_work)
    
    if [ $task_count -eq 0 ]; then
        echo -e "${GREEN}‚úÖ No active work entries found${NC}"
        echo ""
        echo "üí° All tasks are complete or no tasks are in progress"
    else
        echo ""
