# Check for conflicts with given files
check_conflicts() {
    if [ $# -eq 0 ]; then
        echo -e "${RED}‚ùå ERROR: At least one file required${NC}"
        echo "   Usage: $0 check-conflicts <file> [file...]"
        exit 1
    fi
    
    check_coordination_doc
    
    echo -e "${BLUE}üîç Checking for conflicts...${NC}"
    echo ""
    
    local conflicts=0
    
    for file in "$@"; do
        if check_file "$file" > /dev/null 2>&1; then
            echo -e "${GREEN}‚úÖ $file - No conflicts${NC}"
        else
            conflicts=$((conflicts + 1))
        fi
    done
    
    echo ""
    if [ $conflicts -eq 0 ]; then
        echo -e "${GREEN}‚úÖ No conflicts detected${NC}"
        return 0
    else
        echo -e "${YELLOW}‚ö†Ô∏è  $conflicts conflict(s) detected${NC}"
        return 1
    fi
}

# Find which task owns a file
who_owns() {
    local file_path="$1"
    
    if [ -z "$file_path" ]; then
        echo -e "${RED}‚ùå ERROR: File path required${NC}"
        echo "   Usage: $0 who-owns <file-path>"
        exit 1
    fi
    
    check_coordination_doc
    
    echo -e "${BLUE}üîç Finding owner of: $file_path${NC}"
    echo ""
    
    local found=0
    local current_task=""
    local current_branch=""
    local current_status=""
    local current_files=""
    
    while IFS= read -r line; do
        case "$line" in
            "TASK_START")
                current_task=""
                current_role=""
                current_branch=""
                current_status=""
                current_files=""
                ;;
            "### Task:"*)
                current_task="$line"
                ;;
            "**Role:**"*)
                current_role="$line"
                ;;
            "**Branch:**"*)
                current_branch="$line"
                ;;
            "**Status:"*)
                current_status="$line"
                ;;
            "FILES_START")
                ;;
            "FILES_END")
                if echo "$current_files" | grep -q "$file_path"; then
                    found=1
                    echo -e "${YELLOW}üìå File is part of:${NC}"
                    echo ""
                    echo "   $current_task"
                    if [ -n "$current_role" ]; then
                        echo "   $current_role"
                    fi
                    echo "   $current_branch"
                    echo "   $current_status"
                    echo ""
                    echo "   Files in this task:"
                    echo "$current_files" | sed 's/^/     /'
                    echo ""
                    return 0
                fi
                ;;
            "TASK_END")
                ;;
            *)
                if [[ "$line" =~ ^[[:space:]]*- ]]; then
                    current_files="${current_files}${line}"$'\n'
                fi
                ;;
        esac
    done < <(extract_active_work)
    
    if [ $found -eq 0 ]; then
        echo -e "${GREEN}‚úÖ File is not owned by any active task${NC}"
        echo ""
        echo "üí° You can proceed, but check:"
        echo "   1. Is file in 'Shared Files' section?"
        echo "   2. Update coordination doc with your work"
        return 0
    fi
}

# Get status of a specific task
status() {
    local task_name="$1"
    
    if [ -z "$task_name" ]; then
        echo -e "${RED}‚ùå ERROR: Task name required${NC}"
        echo "   Usage: $0 status <task-name>"
        exit 1
    fi
    
    check_coordination_doc
    
    echo -e "${BLUE}üìã Task Status: $task_name${NC}"
    echo ""
    
    # Search for task in coordination doc
    if grep -q "### Task: $task_name" "$COORDINATION_DOC"; then
        # Extract task block
        awk -v task="$task_name" '
        /^### Task: / && $0 ~ task {
            print_task = 1
        }
        print_task && /^## / && !/^### Task: / {
            print_task = 0
        }
        print_task {
            print
        }
        ' "$COORDINATION_DOC"
    else
        echo -e "${YELLOW}‚ö†Ô∏è  Task not found: $task_name${NC}"
        echo ""
        echo "üí° Available tasks:"
        grep "^### Task:" "$COORDINATION_DOC" | sed 's/^### Task: /   - /'
    fi
}

# Main command handler
case "${1:-help}" in
    check-file)
        check_file "${2:-}"
        ;;
    list-active)
        list_active
        ;;
    check-conflicts)
        shift
        check_conflicts "$@"
        ;;
    who-owns)
        who_owns "${2:-}"
        ;;
    status)
        status "${2:-}"
        ;;
    help|--help|-h)
        usage
        ;;
    *)
        echo -e "${RED}‚ùå Unknown command: $1${NC}"
        echo ""
        usage
        exit 1
        ;;
esac

